package irvine.oeis.a000;

import java.math.BigDecimal;

/**
 * A000167 Nearest integer to modified Bessel function <code>K_n(2)</code>.
 * @author Sean A. Irvine
 */
public class A000167 extends A000155 {

  @Override
  protected String k0() {
    // High precision constant BesselK(0,2) computed by Maple
    return "0.";
  }

  @Override
  protected String k1() {
    // High precisions constant BesselK(1,2) computed by Maple
    return "0.";
  }

  private static final BigDecimal TWO = new BigDecimal("2");

  @Override
  protected BigDecimal z() {
    return TWO;
  }
}
